import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Dashboard from './pages/Dashboard';
import Events from './pages/Events';
import MyEvents from './pages/MyEvents';
import Profile from './pages/Profile';
import BottomNav from './components/BottomNav';

function App() {
  const [userName] = useState("Priya Sharma"); //
  const [searchTerm, setSearchTerm] = useState("");

  return (
    <Router>
      <div className="app-container" style={{ maxWidth: '375px', margin: '0 auto', backgroundColor: '#f8fafc', minHeight: '100vh', position: 'relative' }}>
        <Routes>
          <Route path="/" element={<Dashboard userName={userName} searchTerm={searchTerm} setSearchTerm={setSearchTerm} />} />
          <Route path="/events" element={<Events searchTerm={searchTerm} setSearchTerm={setSearchTerm} />} />
          <Route path="/my-events" element={<MyEvents />} />
          <Route path="/profile" element={<Profile userName={userName} />} />
        </Routes>
        <BottomNav />
      </div>
    </Router>
  );
}

export default App;
